use crate::{biguint_to_fp, field_types::*};
use once_cell::sync::Lazy;
use num_bigint::BigUint;

pub struct ParamsSecp256 {
    pub e: u32,
    pub l: u32,             // Python의 HASH.l
    pub p: Fp,
    pub mu: [u64; N_LIMBS + 1], // Barrett 리덕션용
    pub k: [KummerPoint; 4],
    pub gens: [[KummerPoint; 4]; 6],
    pub strategy: Vec<usize>,
}

pub static PARAMS: Lazy<ParamsSecp256> = Lazy::new(|| {
    let e = EXP as u32;
    // Magma/hash.m 기준 l = ceil(log2(3^e))
    // Python/param_load.py 기준 l = ceil(log2(3^e)) + 1
    // Python의 `threeDAC`에서 `l`을 사용하므로 Python 기준을 따름.
    // 154 * log2(3) = 244.09... -> ceil = 245. l = 245 + 1 = 246.
    let l = 246u32; 

    // p = 11 * 2^4 * 3^154 - 1
    // 이 계산은 BigUint로 수행 후 Fp로 변환
    let p_biguint = BigUint::from(11u64) * (BigUint::from(1u64) << 4) 
        * BigUint::from(3u64).pow(e) - BigUint::from(1u64);

    let p = biguint_to_fp(p_biguint);
    let mu: [u64; 5] = [
        7669468602566266254u64,
        14138679512956724476u64,
        34821387603534431u64,
        13824820136524290660u64,
        24u64,
    ];

    // K, gens는 params256.json 또는 하드코딩된 모듈에서 로드
    let k = load_constants_k(); 
    let gens = load_constants_gens();

    // params256.m에서 strategy 배열 로드
    let strategy: Vec<usize> = load_strategy().to_vec();

    ParamsSecp256 { e, l, p, mu, k, gens, strategy }
});

